CREATE TABLE `products_categories` (
  `product_id` int unsigned NOT NULL COMMENT 'Идентификатор товара',
  `category_id` smallint unsigned NOT NULL COMMENT 'Идентификатор категории',
  PRIMARY KEY (`product_id`,`category_id`) COMMENT 'Составной первичный ключ по сочетанию товара и категории',
  KEY `products_categories__category_id_fk` (`category_id`),
  CONSTRAINT `products_categories__category_id_fk` FOREIGN KEY (`category_id`) REFERENCES `categories` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `products_categories__product_id_fk` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Связь товаров и категорий';
