--
-- Table structure for table `users_addresses`
--

DROP TABLE IF EXISTS `users_addresses`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `users_addresses` (
  `user_id` int unsigned NOT NULL COMMENT 'Идентификатор пользователя',
  `address_id` int unsigned NOT NULL COMMENT 'Идентификатор адреса',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Признак того, адрес установлена по умолчанию для пользователя',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата создания записи',
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Дата изменения записи',
  PRIMARY KEY (`user_id`,`address_id`) COMMENT 'Составной первичный ключ по пользователю и адресу',
  KEY `users_addresses__address_id_fk` (`address_id`),
  CONSTRAINT `users_addresses__address_id_fk` FOREIGN KEY (`address_id`) REFERENCES `addresses` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `users_addresses__user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Связи пользователей и адресов доставки';
/*!40101 SET character_set_client = @saved_cs_client */;

